import React from "react";
import "../../assets/css/compeounder.css"; // Adjust the path as needed
import "../../assets/css/innerstyle.css";

const MrdicalBed = () => {
    return (
        <div>
        <section className="service-section" id="MedicalBed">
            <div className="row">
            <div className="col-md-12">
                <div className="why-choose-box avail-card">
                <figure>
                    <img src="images/icons/MediCABed.png" alt="MedicalBed" />
                </figure>
                <h4>MEDICAL BED</h4>
                <a href="#" className="readmoreBtn"><span>Book now</span></a>
                </div>
            </div>
            </div>
        </section>
        </div>
    );
    }
    export default MrdicalBed;
